8.	Natural Gas Quality

	(e)     Objectionable Properties.  The Natural Gas received and delivered:

		(i)	shall be commercially free from particulates or other solid or liquid matter which might interfere with its merchantability or cause injury to or interfere with proper operation of the lines, regulators, meters and other equipment of Operator;

		(ii)	shall not contain more than twenty-five hundredths (0.25) grains of hydrogen sulfide per one hundred (100) cubic feet;

		(iii)	shall not contain more than twenty (20) grains of total sulfur per one hundred (100) cubic feet;

		(iv)	shall not contain more than four percent (4.0%) by volume of nitrogen (N2) and three percent (3.0%) by volume of carbon dioxide (CO2); and shall not contain more than five percent (5.0%) by volume of combined nonhydrocarbon gases including, but not limited to, N2, CO2 and oxygen (O2);

		(v)	shall not contain in excess of seven (7) pounds of water vapor per million cubic feet;

		(vi)	shall not contain O2 in excess of two-tenths of one percent by volume; and

		(vii)	shall not contain any other harmful contaminants, including Hg, which might interfere with the proper operation of or cause damage to Operator's facilities.
